col0\" ><a href=\"#CalibrationMetric-TestDataset_P95U57F6BF9IWKM766I87Y4P2-section-6OPXA\">Calibration Metric - Test Dataset</a></td>\n                        <td id=\"T_4c9371f2_f90b_11ec_9848_faffc267c65frow5_col1\" class=\"data row5 col1\" >Calculate the calibration curve with brier score for each class. <a href=\"https://docs.deepchecks.com/0.8/checks_gallery/tabular/model_evaluation/plot_calibration_score.html?utm_source=display_output&utm_medium=referral&utm_campaign=check_link\" target=\"_blank\">Read More...</a></td>\n            </tr>\n            <tr>\n                                <td id=\"T_4c9371f2_f90b_11ec_9848_faffc267c65frow6_col0\" class=\"data row6 col0\" ><a href=\"#OutlierSampleDetection-TrainDataset_P95U57F6BF9IWKM766I87Y4P2-section-6OPXA\">Outlier Sample Detection - Train Dataset</a></td>\n                        <td id=\"T_4c9371f2_f90b_11ec_9848_faffc267c65frow6_col1\" class=\"data row6 col1\" >Detects outliers in a dataset using the LoOP algorithm. <a href=\"https://docs.deepchecks.com/0.8/checks_gallery/tabular/data_integrity/plot_outlier_sample_detection.html?utm_source=display_output&utm_medium=referral&utm_campaign=check_link\" target=\"_blank\">Read More...</a></td>\n            </tr>\n            <tr>\n                                <td id=\"T_4c9371f2_f90b_11ec_9848_faffc267c65frow7_col0\" class=\"data row7 col0\" ><a href=\"#OutlierSampleDetection-TestDataset_P95U57F6BF9IWKM766I87Y4P2-section-6OPXA\">Outlier Sample Detection - Test Dataset</a></td>\n                        <td id=\"T_4c9371f2_f90b_11ec_9848_faffc267c65frow7_col1\" class=\"data row7 col1\" >Detects outliers in a dataset using the LoOP algorithm. <a href=\"https://docs.deepchecks.com/0.8/checks_gallery/tabular/data_integrity/plot_outlier_sample_detection.html?utm_source=display_output&utm_medium=referral&utm_campaign=check_link\" target=\"_blank\">Read More...</a></td>\n            </tr>\n    </tbody></table>"
